import React from 'react'
import { IProduct } from '../moduls'

interface ProductProps{
    product: IProduct
}

export function Home({product}: ProductProps){
    return (
        <div className='container d-flex flex-column m-0'>
            <div className='d-flex  justify-content-center m-0'>
                <img width={350} height={350} src={product.imageSecond} alt="" />
            </div>
            <h1 className='text-center m-0'>{product.title}</h1>
            <p className='text-center m-0'>{product.price}</p>
        </div>
    )
}
